public class ImageRecipeFactory(string resourceName = null, Action<Humidifier.ImageBuilder.ImageRecipe> factoryAction = null) : ResourceFactory<Humidifier.ImageBuilder.ImageRecipe>(resourceName)
{

    internal List<InnerImageRecipeComponentConfigurationFactory> ComponentsFactories { get; set; } = [];

    internal List<InnerImageRecipeInstanceBlockDeviceMappingFactory> BlockDeviceMappingsFactories { get; set; } = [];

    internal InnerImageRecipeAdditionalInstanceConfigurationFactory AdditionalInstanceConfigurationFactory { get; set; }

    protected override Humidifier.ImageBuilder.ImageRecipe Create()
    {
        var imageRecipeResult = CreateImageRecipe();
        factoryAction?.Invoke(imageRecipeResult);

        return imageRecipeResult;
    }

    private Humidifier.ImageBuilder.ImageRecipe CreateImageRecipe()
    {
        var imageRecipeResult = new Humidifier.ImageBuilder.ImageRecipe
        {
            GivenName = InputResourceName,
        };

        return imageRecipeResult;
    }
    public override void CreateChildren(Humidifier.ImageBuilder.ImageRecipe result)
    {
        base.CreateChildren(result);

        result.Components = ComponentsFactories.Any() ? ComponentsFactories.Select(x => x.Build()).ToList() : null;
        result.BlockDeviceMappings = BlockDeviceMappingsFactories.Any() ? BlockDeviceMappingsFactories.Select(x => x.Build()).ToList() : null;
        result.AdditionalInstanceConfiguration ??= AdditionalInstanceConfigurationFactory?.Build();
    }

} // End Of Class

